import {Link} from 'react-router-dom'

const Dummy_Events = [
  {id: '1', tittle: 'Event 1'},
  {id: '2', tittle: 'Event 2'}
]

export default function EventPage() {
  
  return (
    <>
      <h1>EventPage</h1>
      {Dummy_Events.map(e => <li key={e.id}>
        <Link to={e.id}>{e.tittle}</Link>
        </li>)}
        <Link to='new' >New Event</Link>
    </>
  )
}
